import React, { useState } from "react";
import ExpenseComponent from "./ExpenseComponent";
import Card from "../UI/Card";
import "./Expense.css";
import ExpensesFilter from "../ExpenseFilter/ExpenseFilter";

const Expense = (props) => {
  const [fiteredYear,setFilteredYear]=useState('2020')
  const filterChangeHandler=(selectedYear)=>{
    setFilteredYear(selectedYear)
    console.log(selectedYear)
  }
  return (
    <Card className="expenses">
      <div>
      <ExpensesFilter selected={fiteredYear} onChangeFilter={filterChangeHandler}></ExpensesFilter>
      </div>
      {props.expenses.map((expenses)=>(<ExpenseComponent title={props.expenses.title}
        amount={props.expenses.amount}
        date={props.expenses.date}></ExpenseComponent>))}
      
    </Card>
  );
};
export default Expense;
